import React, { useEffect, useState } from 'react';

const Iframes = ({image})=>{
    const [url,setUrl] = useState("data:image/jpeg;base64," );


    useEffect(()=>{
        if(image==='dog'){
            setUrl("data:image/jpeg;base64,")
        }
        if(image==='cat'){
            setUrl("data:image/jpeg;base64,")
        }
        if(image==='cow'){
            setUrl("data:image/jpeg;base64,")
        }
    },[image]);
   
    return(
        <>
        <iframe scrolling="no" src={url}></iframe>
        </>
    )
}

export default Iframes